import React, { Component } from 'react'

export class Popular extends Component {
  render() {
      const languages=["Js","python","Ruby","Java"];
    return (
      <ul>

            {languages.map((elem)=>{
                return (
                   <li>
                    {elem}
                    </li>
                )
            })}

      </ul>
    )
  }
}

export default Popular
